import AdminPanel from "../pages/AdminPanel";
import Auth from "../pages/Auth";
import Panel from "../pages/Panel";
import { ADMINPANEL_ROUTE, AUTH_ROUTE, PANEL_ROUTE } from "../utils/constants";
import React from 'react';

interface IAuthRoutesItem {
    path: string;
    component: React.ReactElement;
}

export const AuthRoutes: IAuthRoutesItem[] = [
    { path: PANEL_ROUTE, component: <Panel /> },
    { path: ADMINPANEL_ROUTE, component: <AdminPanel /> },
]
export const PublicRoutes: IAuthRoutesItem[] = [
    { path: AUTH_ROUTE, component: <Auth /> }
]
